import React from 'react';

const HR = () => {
    const employees = ["John", "Jane", "Mike", "Emily"];
    const clients = ["Apple", "Microsoft", "Google", "Amazon"];

    return (
        <div className="grid grid-cols-2 gap-4 border border-gray-500 p-4 justify-center">
            <div className="text-center">
                <h1 className="uppercase">Employ√©s</h1>
                <ul>
                    {employees.map((employee, index) => (
                        <li key={employee}>
                            {employee}
                        </li>
                    ))}
                </ul>
            </div>
            <div className="text-center">
                <h1 className="uppercase">Clients</h1>
                <ul>
                    {clients.map((client, index) => (
                        <li key={client}>
                            {client}
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );
};

export default HR;
